column58:
The requirement to undertake cleaning services to the Trowbridge Town Council buildings/assets. The largest two sites are, The Civic Centre which is mixed-use by means of offices for the town council and tenants along with a venue which caters for events ranging from 10-1000 people attending and operating over 7 days per week and Trowbridge Museum, open to the public 5 days per week, Tuesday - Saturday with an average daily footfall of 100 per day. Other sites include: The Longfield Community Centre, Trowbridge Cemetery (Chapel and Conveniences), Walkers Yard (Storage and Rangers base) and the Public Conveniences due to open this year in Trowbridge park.

Additional information: Site Visits;
Can be arranged in advance with the site managers listed in the documentation.
